import React from 'react';

import {
    Animated
} from "react-animated-css";


class CardPartners extends React.Component {
    render() {
        return (
            <div className="col-12 col-md-6 col-lg-2 padding-top-bottom-companies">
                <div
                    id={"button-modal"}
                    className="landing-company-div-card">
                    <div className="row row-icon-block">
                        <div className="col-12">
                            <div id={"company-wrapper"}>
                                <div
                                    className={"company"}
                                    id={this.props.image}
                                />
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

class CardPartnersMobile extends React.Component {
    render() {
        return (
            <div className="col-6 padding-top-bottom-companies">
                <div
                    id={"button-modal"}
                    className="landing-company-div-card">
                    <div className="row row-icon-block">
                        <div className="col-12">
                            <div id={"company-wrapper"}>
                                <div
                                    className={"company"}
                                    id={this.props.image}
                                />
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export {
    CardPartners as default,
    CardPartnersMobile
};
